import React, { useState, useEffect } from "react";
import { BrowserRouter as Router, Route, Routes, useNavigate, useLocation } from "react-router-dom";
import axios from "axios";
import "./main.css";

function Catalog() {
    const [books, setBooks] = useState([]);
    useEffect(() => {
        axios.get("http://localhost:5000/catalog").then(res => setBooks(res.data));
    }, []);

    const addToCart = (bookId) => {
        axios.post("http://localhost:8081/cart/add", { bookId });
    };

    return (
        <div className="catalog">
            <h1>Catalog</h1>
            <ul>
                {books.map(book => (
                    <li key={book.id}>
                        <img src={book.image_url} alt={book.title} style={{ width: "100px" }} />
                        {book.title} by {book.author} - ${book.price}
                        <button onClick={() => addToCart(book.id)}>Add to Cart</button>
                    </li>
                ))}
            </ul>
        </div>
    );
}

function Cart() {
    const [cartItems, setCartItems] = useState([]);
    const [customerName, setCustomerName] = useState("");
    const navigate = useNavigate();

    useEffect(() => {
        axios.get("http://localhost:8081/cart").then(res => setCartItems(res.data));
    }, []);

    const handleCheckout = () => {
        axios.post("http://localhost:8081/cart/order", { customerName }, { headers: { "Session-ID": localStorage.getItem("sessionId") } })
            .then(res => navigate("/payment", { state: { orderId: res.data } }));
    };

    return (
        <div className="container">
            <h1>Shopping Cart</h1>
            <input value={customerName} onChange={e => setCustomerName(e.target.value)} placeholder="Your Name" />
            <ul>
                {cartItems.map(item => (
                    <li key={item.id}>{item.title} - ${item.price} x {item.quantity}</li>
                ))}
            </ul>
            <button onClick={handleCheckout}>Checkout</button>
        </div>
    );
}

function Payment() {
    const navigate = useNavigate();
    const location = useLocation();
    const [card, setCard] = useState("");
    const [month, setMonth] = useState("0");
    const [year, setYear] = useState("0");
    const [cvv, setCvv] = useState("");
    const orderId = location.state?.orderId;

    const handleSubmit = (e) => {
        e.preventDefault();
        const expdate = `${year}-${month.padStart(2, "0")}-01`;
        axios.post("http://localhost:8081/cart/payment", { orderId, ccnum: card, expdate, seccode: cvv })
            .then(res => navigate(res.data === "success" ? "/success" : "/tryagain"));
    };

    return (
        <div className="paymentContainer">
            <h3>Payment</h3>
            <form onSubmit={handleSubmit}>
                <label>Card Number:</label>
                <input type="number" value={card} onChange={e => setCard(e.target.value)} required />
                <label>Expiry:</label>
                <select value={month} onChange={e => setMonth(e.target.value)}>
                    {Array.from({ length: 12 }, (_, i) => i + 1).map(m => <option key={m} value={m}>{m}</option>)}
                </select>
                <select value={year} onChange={e => setYear(e.target.value)}>
                    {Array.from({ length: 5 }, (_, i) => 2025 + i).map(y => <option key={y} value={y}>{y}</option>)}
                </select>
                <label>CVV:</label>
                <input type="number" value={cvv} onChange={e => setCvv(e.target.value)} required />
                <button type="submit">Pay</button>
            </form>
        </div>
    );
}

function App() {
    useEffect(() => {
        axios.post("http://localhost:8081/cart/session").then(res => localStorage.setItem("sessionId", res.data));
    }, []);

    return (
        <Router>
            <Routes>
                <Route path="/catalog" element={<Catalog />} />
                <Route path="/cart" element={<Cart />} />
                <Route path="/payment" element={<Payment />} />
            </Routes>
        </Router>
    );
}

export default App;
